import { useEffect } from "react";
import { Outlet, useSubmit } from "react-router-dom";

import MainNavigation from "../components/MainNavigation";

function RootLayout() {
  const submit = useSubmit()
  useEffect(() => {
    setTimeout(() => {
      submit(null, {path: '/', method: 'post'});
    }, 1 * 60 * 60 * 1000);
  }, [submit])
  return (
    <>
      <MainNavigation />
      <main>
        <Outlet />
      </main>
    </>
  );
}

export default RootLayout;
